import React from 'react';
import './App.css';
import { BrowserRouter, Route, Switch } from 'react-router-dom';
import  { Login } from './Login/Login.js';
import {StudentsTable} from './StudentsTable/StudentsTable.js'



function App() {
  return (
    <div className="wrapper">
      <h1>Application</h1>
      <BrowserRouter>
        <Switch>
          <Route path="/Login">
            <Login />
          </Route>
          <Route path="/StudentsTable">
            <StudentsTable />
          </Route>
        </Switch>
      </BrowserRouter>
    </div>
    // <React.Fragment>
    //   // <Login/>
    //   {/* <StudentsTable/> */}
    // </React.Fragment>

  );
}

export default App;
